function Breadcrumb({links}) {
    return (
        <div className="breadcrumb">
            {
                links.map(link => {
                    return (
                            link.activeLink ?
                            <span className="breadcrumb-link">
                                <a href={link.toPage}>{link.linkName}</a>
                                <span className="breadcrumb-link">{link.separator}</span>
                            </span> :
                            link.linkName
                    )
                })
            }
        </div>
    )
}

export default Breadcrumb
